class Queue{#t=[];constructor(){}enqueue(t){this.#t.push(t)}dequeue(){return this.#t.length>0?this.#t.shift():void 0}clear(){this.#t=[]}peek(){return this.#t.length>0?this.#t[0]:void 0}get length(){return this.#t.length}values(){return[...this.#t]}contains(t){return this.#t.includes(t)}get isEmpty(){return 0===this.#t.length}display(){console.log(`Queue (${this.#t.length}) {\n ${this.#t.join(", ")}\n}`)}}